ded trip. The total trip durations (in mins) for each of the recorded months were added up using a function from the lubridate package."]},{"cell_type":"code","execution_count":10,"id":"3d8013a2","metadata":{"execution":{"iopub.execute_input":"2022-09-16T20:13:05.684969Z","iopub.status.busy":"2022-09-16T20:13:05.683084Z","iopub.status.idle":"2022-09-16T20:13:06.809669Z","shell.execute_reply":"2022-09-16T20:13:06.807829Z"},"papermill":{"duration":1.14801,"end_time":"2022-09-16T20:13:06.812074","exception":false,"start_time":"2022-09-16T20:13:05.664064","status":"completed"},"tags":[]},"outputs":[],"source":["monthly_total_trip_duration <- complete_divvy_tripdata %>%\n","  group_by(month = lubridate::floor_date(started_at, \"month\")) %>%\n","  summarize(total_trip_duration = sum(trip_duration))\n","\n","view(monthly_total_trip_duration)"]},{"cell_type":"markdown","id":"49be51d4","metadata":{"papermill":{"duration":0.016385,"end_time":"2022-09-16T20:13:06.845034","exception":false,"start_time":"2022-09-16T20:13:06.828649","status":"completed"},"tags":[]},"source":["From the resulting table, we notice that there is a greater total trip duration (in mins) in the summer months which become much lower during the winter season. We create a visualization of this to get a better understanding of just how drastic the change was. In order to do so, we appropriately convert the month variable from a date time data type to a date data type. Furthermore, we divide the total trip duration (in mins) by a million to get a better fit of values for the y-axis on the graph."]},{"cell_type":"code","execution_count":11,"id":"3923cd27","metadata":{"execution":{"iopub.execute_input":"2022-09-16T20:13:06.881523Z","iopub.status.busy":"2022-09-16T20:13:06.879921Z","iopub.status.idle":"2022-09-16T20:13:07.392627Z","shell.execute_reply":"2022-09-16T20:13:07.390949Z"},"papermill":{"duration":0.534559,"end_time":"2022-09-16T20:13:07.396047","exception":false,"start_time":"2022-09-16T20:13:06.8614