UVORK5CYII="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["monthly_mean_trip_duration <- complete_divvy_tripdata %>%\n","  group_by(month = lubridate::floor_date(started_at, \"month\"), member_casual) %>%\n","  summarize(mean_trip_duration = mean(trip_duration))\n","\n","monthly_mean_trip_duration[1] <- as.Date(monthly_mean_trip_duration$month)\n","\n","ggplot(monthly_mean_trip_duration, aes(x=month, y=mean_trip_duration, group = member_casual, color = member_casual)) +\n","  geom_line() +\n","  geom_point() +\n","  scale_y_continuous(breaks = seq(10, 40, 2),\n","                     limits = c(10, 40)) +\n","  scale_x_date(date_breaks = \"1 month\", date_labels = \"%b-%y\") +\n","  theme(axis.text.x = element_text(angle = 90, vjust = 0.5)) +\n","  xlab(\"Month\") +\n","  ylab(\"Mean Trip Duration (mins)\") +\n","  labs(title = \"Mean Trip Duration by Month\", \n","       subtitle = \"Data from May 2021 - Apr 2022\",\n","       caption = \"Source: Divvy (https://ride.divvybikes.com/system-data)\",\n","       color = \"\")"]},{"cell_type":"markdown","id":"ce0cdf07","metadata":{"papermill":{"duration":0.022232,"end_time":"2022-09-16T20:13:13.28791","exception":false,"start_time":"2022-09-16T20:13:13.265678","status":"completed"},"tags":[]},"source":["Once again, there were no new trends seen. The mean trip duration for casual riders are shown to be much greater and more variable when compared to annual members, which is in-line with our previous analysis. "]},{"cell_type":"markdown","id":"89c82c0a","metadata":{"papermill":{"duration":0.02218,"end_time":"2022-09-16T20:13:13.332131","exception":false,"start_time":"2022-09-16T20:13:13.309951","status":"completed"},"tags":[]},"source":["To further investigate the divide between casual riders and annual members, we will now explore the count_of_day variable to see the distribution of riders throughout the week. "]},{"cell_type":"code","execution_count":16,"id":"52affd16","metadata":{"execution":{"iopub.execute_input":"2022-09-16T20:13:13.379324Z","iopub.status.busy":"2022-09-16T20:13:13.377817Z","iopub.status.idle":"2022-09-16T20:13:14.706246Z","shell.execute_reply":"2022-09-16T20:13:14.704583Z"},"papermill":{"duration":1.354552,"end_time":"2022-09-16T20:13:14.708507","exception":false,"start_time":"2022-09-16T20:13:13.353955","status":"completed"},"tags":[]},"outputs":[],"source":["monthly_count_day_of_week <- complete_divvy_tripdata %>%\n","  group_by(month = lubridate::floor_date(started_at, \"month\"), member_casual) %>%\n","  count(day_of_week, month)\n","\n","monthly_count_day_of_week[1] <- as.Date(monthly_count_day_of_week$month)\n","\n","monthly_count_day_of_week[3] <- as.character(monthly_count_day_of_week$day_of_week)\n","\n","monthly_count_day_of_week[4] <- as.numeric(monthly_count_day_of_week$n)\n","\n","view(monthly_count_day_of_week)"]},{"cell_type":"markdown","id":"a9b22087","metadata":{"papermill":{"duration":0.022131,"end_time":"2022-09-16T20:13:14.752383","exception":false,"start_time":"2022-09-16T20:13:14.730252","status":"completed"},"tags":[]},"source":["In the above code, we converted the data types of our variables so that they work nicely when we end up creating a visualization of the data. As seen in the table, it is hard to clearly make out any trends that appear due to how the data is organized. From our analysis for far, it seems that the season has a big role in influencing ridership which is apparent in casual riders as seen from our graphs. Thus, we will direct our focus onto the months of May, June, and July, as they showed the biggest differences in total trip duration between casual riders and annual members. "]},{"cell_type":"code","execution_count":17,"id":"397d5642","metadata":{"execution":{"iopub.execute_input":"2022-09-16T20:13:14.800022Z","iopub.status.busy":"2022-09-16T20:13:14.798409Z","iopub.status.idle":"2022-09-16T20:13:15.475922Z","shell.execute_reply":"2022-09-16T20:13:15.47396Z"},"papermi